import React, { useEffect, useState } from 'react';
import axios from "axios";
import './addProduct.css';

const AddProduct = () => {
  const [productId, setProductId] = useState('');
  const [productName, setProductName] = useState('');
  const [brand, setBrand] = useState('');
  const [supplier, setSupplier] = useState('');
  const [cost, setCost] = useState(0);
  const [category, setCategory] = useState('');
  const [subcategory, setSubcategory] = useState('');
  const [products, setProducts] = useState([]);

  let categories = useState([]);

  useEffect (() => {
    var config = {
      method: 'post',
      url: 'http://localhost:8044/getAllProductCategory',
      headers:{"Content-Type": "application/json"},
      data : {}
    };
    axios(config).then((res) => {
      categories = res.dataList
    });
  },[]);

  const handleSubmit = (event) => {
    event.preventDefault();

    const newProduct = {
      productId,
      productName,
      brand,
      supplier,
      cost,
      category, 
      subcategory,
    };

    setProducts([...products, newProduct]); // Add new product to in-memory data

    // Clear form fields after submission (optional)
    setProductId('');
    setProductName('');
    setBrand('');
    setSupplier('');
    setCost(0);
    setCategory(''); // Clear selected category
    setSubcategory('');
  };

  const handleFileUpload = (event) => {
    const file = event.target.files[0];

    // Implement logic to process the uploaded Excel file
    // You'll need an external library like `xlsx` to parse the file
    // This is an example using `xlsx` (not included by default):
    //
    // const reader = new FileReader();
    // reader.onload = (e) => {
    //   const arrayBuffer = e.target.result;
    //   const workbook = XLSX.read(arrayBuffer, { type: 'array' });
    //   const sheetName = workbook.SheetNames[0];
    //   const worksheet = workbook.Sheets[sheetName];
    //   // Extract product data from the worksheet and add to products state
    // };
    // reader.readAsArrayBuffer(file);
  };

  return (
    <div className="add-product-page">
      
      <div className="upload-button-container">
        <label htmlFor="fileUpload">Upload Excel File (Optional):</label>
        <input
          type="file"
          id="fileUpload"
          accept=".xlsx,.xlsm,.xlsb"
          onChange={handleFileUpload}
        />
      </div>
      <h2>Add Product</h2>
      <form onSubmit={handleSubmit}>
        <label htmlFor="productId">Product ID:</label>
        <input
          type="text"
          id="productId"
          value={productId}
          onChange={(e) => setProductId(e.target.value)}
          required
        />
        <label htmlFor="productName">Product Name:</label>
        <input
          type="text"
          id="productName"
          value={productName}
          onChange={(e) => setProductName(e.target.value)}
          required
        />
        <label htmlFor="brand">Brand:</label>
        <input
          type="text"
          id="brand"
          value={brand}
          onChange={(e) => setBrand(e.target.value)}
          required
        />
        <label htmlFor="supplier">Supplier:</label>
        <input
          type="text"
          id="supplier"
          value={supplier}
          onChange={(e) => setSupplier(e.target.value)}
          required
        />
        <label htmlFor="cost">Cost:</label>
        <input
          type="number"
          id="cost"
          value={cost}
          onChange={(e) => setCost(e.target.value)}
          required
        />
        <label htmlFor="category">Category:</label>
        <select
          id="category"
          value={category}
          onChange={(e) => setCategory(e.target.value)}
          required
        >
          <option value="">Select Category</option>
          {categories.map((category) => (
            <option key={category} value={category}>
              {category}
            </option>
          ))}
        </select>
        <label htmlFor="subcategory">Subcategory:</label>
        <input
          type="text"
          id="subcategory"
          value={subcategory}
          onChange={(e) => setSubcategory(e.target.value)}
          required
        />
         
        <button type="submit">Add Product</button>
      </form>
    </div>
  );
};

export default AddProduct;
